/**
 * Uses the new array typed in javascript to binary base64 encode/decode
 * at the moment just decodes a binary base64 encoded
 * into either an ArrayBuffer (decodeArrayBuffer)
 * or into an Uint8Array (decode)
 *
 * References:
 * https://developer.mozilla.org/en/JavaScript_typed_arrays/ArrayBuffer
 * https://developer.mozilla.org/en/JavaScript_typed_arrays/Uint8Array
 */

var Base64Binary = {
	_keyStr: "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=",

	/* will return a  Uint8Array type */
	decodeArrayBuffer: function(input) {
		var bytes = (input.length / 4) * 3;
		var ab = new ArrayBuffer(bytes);
		this.decode(input, ab);

		return ab;
	},

	removePaddingChars: function(input) {
		var lkey = this._keyStr.indexOf(input.charAt(input.length - 1));
		if (lkey == 64) {
			return input.substring(0, input.length - 1);
		}
		return input;
	},

	decode: function(input, arrayBuffer) {
		//get last chars to see if are valid
		input = this.removePaddingChars(input);
		input = this.removePaddingChars(input);

		var bytes = parseInt((input.length / 4) * 3, 10);

		var uarray;
		var chr1, chr2, chr3;
		var enc1, enc2, enc3, enc4;
		var i = 0;
		var j = 0;

		if (arrayBuffer)
			uarray = new Uint8Array(arrayBuffer);
		else
			uarray = new Uint8Array(bytes);

		input = input.replace(/[^A-Za-z0-9\+\/\=]/g, "");

		for (i = 0; i < bytes; i += 3) {
			//get the 3 octects in 4 ascii chars
			enc1 = this._keyStr.indexOf(input.charAt(j++));
			enc2 = this._keyStr.indexOf(input.charAt(j++));
			enc3 = this._keyStr.indexOf(input.charAt(j++));
			enc4 = this._keyStr.indexOf(input.charAt(j++));

			chr1 = (enc1 << 2) | (enc2 >> 4);
			chr2 = ((enc2 & 15) << 4) | (enc3 >> 2);
			chr3 = ((enc3 & 3) << 6) | enc4;

			uarray[i] = chr1;
			if (enc3 != 64) uarray[i + 1] = chr2;
			if (enc4 != 64) uarray[i + 2] = chr3;
		}
		return uarray;
	}
}

// dont run the _main, yet.
var Module = Module || {};
Module.noInitialRun = true;

window.onload = function() {

	var argv = window.location.search.substring(1).split("&");

	//Module['arguments'].push("-paper match"); // hardcode a paper size match from PDF defined size

	argv.forEach(function(a) {
		if (a.length > 0) Module['arguments'].push(a);
	});
	// last and last but one are files
	var infile = argv[argv.length - 2];
	var outfile = argv[argv.length - 1];

	if (infile && outfile) {
		chrome.storage.local.get(infile, function(file) {

			document.getElementById("status").innerHTML += "<br>loading pdf file<br>";
			Module['FS_createDataFile'](".", infile, Base64Binary.decode(file[infile]), true, true);
			document.getElementById("status").innerHTML += "<br>converting document<br>";
			Module['callMain'](Module['arguments']);
			document.getElementById("status").innerHTML += "<br>writing output file<br>";
			var buf = FS.readFile(outfile, {
				encoding: "utf8"
			});
			chrome.storage.local.set({
				[outfile]: buf
			});
			document.getElementById("status").innerHTML += "<br>done<br>";
		})
	}
	else Module['callMain'](Module['arguments']);
}

